column8:
ＬＳ４６０の車高を純正より低い位置で調整できる、レベライザーとアームをつなぐロッドです。長さの違うロッドに交換することで、車高調整コンピューターへのフィードバック値が変わり、純正より低い位置に補正される仕組みです。 <br>純正ロッドと交換するだけでフロント30mm、リア40mmほど車高がダウンします。調整は純正程度の車高から、かなりの落ち幅まで可能です。純正の車高調整機能にも対応してます。<br>※納期に多少お時間がかかります。 <br>対応車種：LEXUS LS600h/hL <br>　車検対応品<br>足回り/足回りその他<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


