クールテープはとても薄く、軽量、フレキシブルで取付けが簡単です。ホース、フューエルライン、電気系配線に使用します。 <br>DEIは1995年にアメリカ オハイオ州で創業。エンジン等から発生する熱をチューニングして車のパフォーマンスを向上させる為に150点以上の製品を提供しています。SCCA・SEMAの会員でも有りレースからストリートまで幅広いユーザーから指示されているメーカーです。<br><br>■サイズ：1-3/8インチX30フィート（35mmX9M）　 <br>汎用品 <br>　<br>エンジンパーツ/エンジンパーツその他<tr><td colspan="2">
